package com.aic.ssm.util;

import java.io.UnsupportedEncodingException;
import java.util.ArrayList;
import java.util.Date;
import java.util.List;

import com.sun.org.apache.xml.internal.security.exceptions.Base64DecodingException;
import com.sun.org.apache.xml.internal.security.utils.Base64;

public class testGetData extends waveformDispose{
	public static void main(String[] args) throws Base64DecodingException, UnsupportedEncodingException {
//		String Base64Str = "";
		String Base64Str = "";
		byte[] floatdecode = Base64.decode(Base64Str);
		double[] InputSignalArray=new double[floatdecode.length/4];
		for (int i = 0,j = 0; i < floatdecode.length; i+=4,j++) {
			 byte[] b = new byte[4];
			 b[0]= floatdecode[i];
			 b[1]= floatdecode[i+1];
			 b[2]= floatdecode[i+2];
			 b[3]= floatdecode[i+3];
			 float fvalue=byte2float(b, 0);
			 InputSignalArray[j] = fvalue;
		}
		System.out.println("testGetData.main()");
		double getRMS = GetRMS( InputSignalArray, 4096);//有效值
		System.out.println("有效值"+getRMS);
		double GetMin = GetMin( InputSignalArray, 4096);//最小值
		System.out.println("最小值"+GetMin);
		double GetMax = GetMax( InputSignalArray, 4096);//最大值
		System.out.println("最大值"+GetMax);
		double GetSlope = GetSlope( InputSignalArray, 4096);//斜度
		System.out.println("斜度"+GetSlope);
		double GetKurtosis = GetKurtosis( InputSignalArray, 4096);//峭度
		System.out.println("峭度"+GetKurtosis);
		double GetWaveFactor = GetWaveFactor( InputSignalArray, 4096); //波形指标
		System.out.println("波形指标"+GetWaveFactor);
		double GetPeakFactor = GetPeakFactor( InputSignalArray, 4096);//峰值指标
		System.out.println("峰值指标"+GetPeakFactor);
		double GetPulseFactor = GetPulseFactor( InputSignalArray, 4096);//脉冲指标
		System.out.println("脉冲指标"+GetPulseFactor);
		double GetClearanceFactor = GetClearanceFactor( InputSignalArray, 4096);//裕度指标
		System.out.println("裕度指标"+GetClearanceFactor);
		double GetKurtosisFactor = GetKurtosisFactor( InputSignalArray, 4096);//峭度指标
		System.out.println("峭度指标"+GetKurtosisFactor);
	}
	
	//这个函数将byte转换成float
	public static float byte2float(byte[] b, int index) {  
	    int l;                                           
	    l = b[index + 0];                                
	    l &= 0xff;                                       
	    l |= ((long) b[index + 1] << 8);                 
	    l &= 0xffff;                                     
	    l |= ((long) b[index + 2] << 16);                
	    l &= 0xffffff;                                   
	    l |= ((long) b[index + 3] << 24);                
	    return Float.intBitsToFloat(l);                  
	}
	
	
}
